member.summary:
Gets and sets the property Reason. 


Specifies the reason that the user session was assigned this variation. Possible values
include DEFAULT, meaning the user was served the default variation; LAUNCH_RULE_MATCH,
if the user session was enrolled in a launch; EXPERIMENT_RULE_MATCH,
if the user session was enrolled in an experiment; or ENTITY_OVERRIDES_MATCH,
if the user's entityId matches an override rule.
